	$buttonPowerState_Click={
		$MainForm.Cursor = "WaitCursor"
		foreach ($Computer in $Target)
		{
			$result = get-AMTPowerState $Computer -credential $VProCredential
			if ($result."Power State Description" -eq "On (S0)")
			{
				Add-Results "$Computer`tAMTPowerState-On"
			}
			elseif ($result."Power State Description" -eq "Off (S5)")
			{
				Add-Results "$Computer`tAMTPowerState-Off"
			}
			elseif ($result."Power State Description" -eq "Hibernate (S4)")
			{
				Add-Results "$Computer`tAMTPowerState-Hibernate"
			}
			elseif ($result."Power State Description" -eq "Standby (S3)")
